Toto - 99 [promo].VOB



HQ very rare promo music video. &quot;99&quot; is a song by the American rock band Toto. The song appeared on the Hydra album in 1979 and is considered one of the band's biggest hits.

Hydra is the second studio album by American rock band Toto, released in 1979. It reached #37 on the Billboard Pop Albums.

This song written as a tribute to George Lucas' film THX 1138 and the music video resembles a scene in the movie. In this promo video, as in the movie scene where the main character (named &quot;THX-1138&quot;) is imprisoned, the room is completely white and everyone is wearing a white jumpsuit.

Toto Legend (the former official International Toto Fan Club newsletter) reviewed this promo video:
&quot;'99' was predominantly a performance video, though the set design was rather conceptual. Following David Paich's intention regarding the lyrics, about a sterile society in which names are forgotten and love forbidden, the set was sterile white, with various sized sculptured 99's hanging and standing about, and the band was clad in futuristic white jumpsuits. There were some notable shots in this one - keyboard close-ups and an artistic view of Jeff through a transparent drum head, a technique that several popular videos have copied since.&quot;
(video does not have any logos)


